using System.IO.Compression;
using System.Text;
using GameFrameX.Utility;

namespace GameFrameX.Tests;

public class CompressTest
{
    private byte[] bytes;
    private byte[] comData;

    [SetUp]
    public void Setup()
    {
        bytes = Encoding.UTF8.GetBytes("");
    }

    [Test]
    public void Test()
    {
        comData = CompressionHelper.Compress(bytes);
        var data = CompressionHelper.Decompress(comData);
        Assert.That(bytes, Is.EqualTo(data));
    }

    [Test]
    public void Compress_And_Decompress_Should_Roundtrip()
    {
        try
        {
            // 准备原始数据
            

            // 压缩（使用 GZipStream 压缩）
            byte[] compressedData;
            using (var ms = new MemoryStream())
            {
                using (var gzs = new GZipStream(ms, CompressionLevel.Optimal))
                {
                    gzs.Write(bytes, 0, bytes.Length);
                }

                compressedData = ms.ToArray();
            }

            // 解压缩（使用上述修正后的方法）
            var decompressedData = CompressionHelper.Decompress(compressedData);

            // 验证结果
            Assert.That(decompressedData, Is.EqualTo(bytes));
        }
        catch (Exception e)
        {
            Console.WriteLine(e);
            throw;
        }
    }
}